import React from 'react'

const QuizFooter = () => {
    return (
        <footer>
            <div className="footer-container">
                <p>Projet réalisé par la Coronagency</p>
                <p>Les icônes sont sur iconFinder.com</p>
            </div>
        </footer>
    )
}

export default QuizFooter
